webpackJsonp([92499185412203],{448:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Yanda's Lab",subtitle:"The existence of this blog fills you with determination.",copyright:"© All rights reserved.",menu:[{label:"Articles",path:"/"},{label:"Projects",path:"/projects/"},{label:"About me",path:"/about/"}],author:{name:"Yanda Huang",email:"yanda@cmu.edu",github:"yodahuang",rss:"#"}}},markdownRemark:{id:"/home/yanda/Development/yodahuang.github.io/src/pages/projects/cabot/index.md absPath of file >>> MarkdownRemark",html:'<h2>What is Cabot?</h2>\n<p>Cabot is an assistive robot designed to help visually impaired users navigate through a new\nenvironment. The user will use this suitcase-shaped robot to aid them in traversing new indoor\nenvironments.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/cabot-9b347cdbeb6e44a0783043858c5b43f2-d5e22.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="cabot"\n        title=""\n        src="/static/cabot-9b347cdbeb6e44a0783043858c5b43f2-d5e22.jpg"\n        srcset="/static/cabot-9b347cdbeb6e44a0783043858c5b43f2-4b207.jpg 240w,\n/static/cabot-9b347cdbeb6e44a0783043858c5b43f2-f76cd.jpg 480w,\n/static/cabot-9b347cdbeb6e44a0783043858c5b43f2-d5e22.jpg 750w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>How does it work?</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/Physical_arch-009ad3025779c87532f5477574fd21d6-6b70d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.84764542936288%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cyberphisical Architecture"\n        title=""\n        src="/static/Physical_arch-009ad3025779c87532f5477574fd21d6-c83f1.png"\n        srcset="/static/Physical_arch-009ad3025779c87532f5477574fd21d6-569e3.png 240w,\n/static/Physical_arch-009ad3025779c87532f5477574fd21d6-93400.png 480w,\n/static/Physical_arch-009ad3025779c87532f5477574fd21d6-c83f1.png 960w,\n/static/Physical_arch-009ad3025779c87532f5477574fd21d6-6b70d.png 1083w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The cyberphysical architecture is shown above. Lidar and Kinect are the main sensor used, and all the communication is done in ROS. Since it’s a robot specifically designed for the blind, we implemented turn-by-turn voice feedback, pedestrain warning as well as dial destination selection interface.</p>\n<h2>You always use the word “we”, what part do you do then?</h2>\n<p>Basically I made all the software for Cabot, which are all <a href="https://github.com/realCabot">opensourced on Github</a>. I’m not familiar with the driver system and the PCB design though.</p>\n<h2>Want more info?</h2>\n<p>Visit the <a href="https://mrsdprojects.ri.cmu.edu/2017teamg/">official website for Cabot</a></p>',frontmatter:{title:"Cabot",date:null,description:"An assistive robot for the visually impaired to navigate indoor. The video is just for demonstration purpose, but not the real product."}}},pathContext:{slug:"/projects/cabot/"}}}});
